{'message': '据BBC报道，曾在《帝国的毁灭》电影中饰演阿道夫.希特勒一角的布鲁诺.甘茨(BrunoGanz，1941.3.22~2019.2.16)于2019年2月16日在家中去世，享年77岁。
布鲁诺甘茨于1941年出生于瑞土苏黎世，他曾出演过《柏林苍穹下》、《朗读者》 等电影,他在《帝国的毁灭》中饰演的阿道夫希特勒一角给观众们留下了深刻的印象。

让我们共同悼念这位伟大的演员，以及铭记他的传奇电影人生', 'plat': 0, 'device': ''}

{'message': '这首歌有男生翻唱/跳来着！

Dance To The Music，我们别名是《香街一歌》【唯一中国面孔】【走秀BGM唯一华语歌曲】欧莱雅110周年巴黎香榭丽舍大道秀场响起的唯一一首华语音乐《dance to the music》，由李宇春填词，张亚东作曲[赞]（听说本来李总打算取名《晃点》？）

舞蹈版MV一镜到底，喜欢！', 'plat': 0, 'device': ''}

{'message': '那个私人助理服务貌似就一年期限，过了之后每年3000刀的服务费。

“手工打造”这个词本身就是炒作出的概念，手工打造并不会比机器造出来更好，甚至在统一性上远不如机器造的，本来应该是“更差”的意思，却被硬生生的炒作成了“更好“，制造一个东西用手工还是用机器纯粹取决于产量，一条完善的全自动生产线价格不菲，如果产量不够，那就是造一台亏一台，在产量低的情况下，用人工是最好的省钱办法。

况且那些所谓的”手工打造“，你以为他们真的是一个螺丝一个配件都用人手用矬子剪刀锤子一个个打磨出来的么？实际的情况是零件还是机器做的，人只是组装一下而已。说白了，中国那些山寨小厂，个个都是”全手工打造“', 'plat': 0, 'device': ''}
